ff on my site so i am starting to think this is related to my hosting or something I have set up incorrectly in my .htaccess or php settings? But my hosting provider is a one man band who never gets back to us, pretty terrible host provider tbf but i dont make the decision when it comes to our host, so i thought I would try to settle this myself before going to my hosting provider as I know he will take ages or give me very little support.</p>\n<p>Im lost Ive looked online to find nothing related to the above error message and WordPress. A moderator for the WordPress plugin forum said WordPress doesnt even use sessions. So what could this be? This is really doing my head in, Its the one thing thats stopping me from wanting to take my site live, first impressions mean a lot and i dont want a ton of errors popping up for our visitors.</p>\n<p>Hope someone can help</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"mikemcox90\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://wordpress.org/support/topic/how-do-i-tell-google-to-ignore-a-url-that-is-not-a-page-or-post/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"How do I tell Google to ignore a URL that is not a page or post?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:100